import{_ as e,c as t,o as n,ag as l}from"./chunks/framework.DPDPlp3K.js";const m=JSON.parse('{"title":"Installation with Official Minecraft Launcher (Vanilla Launcher)","description":"","frontmatter":{},"headers":[],"relativePath":"install/install_vanilla.md","filePath":"install/install_vanilla.md","lastUpdated":1744207748000}'),o={name:"install/install_vanilla.md"};function i(r,a,s,c,d,h){return n(),t("div",null,a[0]||(a[0]=[l('<h1 id="installation-with-official-minecraft-launcher-vanilla-launcher" tabindex="-1">Installation with Official Minecraft Launcher (Vanilla Launcher) <a class="header-anchor" href="#installation-with-official-minecraft-launcher-vanilla-launcher" aria-label="Permalink to &quot;Installation with Official Minecraft Launcher (Vanilla Launcher)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>⚠️ Not recommended — setup is more complicated. <br> We would recommend to use <a href="./install_prism">Prism Launcher</a> instead.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This document will not explain the process of installing and logging into your Microsoft Account.</p></div><h2 id="install-fabric-loader" tabindex="-1">Install Fabric Loader <a class="header-anchor" href="#install-fabric-loader" aria-label="Permalink to &quot;Install Fabric Loader&quot;">​</a></h2><p>Get the installer here: <a href="https://fabricmc.net/use/installer/" target="_blank" rel="noreferrer">https://fabricmc.net/use/installer/</a>. Open the installer, select <code>1.16.1</code> as the Minecraft version and the latest Fabric version, and finish the installation.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>You do <strong>NOT</strong> need Fabric API, it is banned and none of the allowed mods use it!</p></div><h2 id="download-the-mods" tabindex="-1">Download the mods <a class="header-anchor" href="#download-the-mods" aria-label="Permalink to &quot;Download the mods&quot;">​</a></h2><p>Download the MCSR Ranked mod from <a href="http://modrinth.com/mod/mcsr-ranked" target="_blank" rel="noreferrer">the Modrinth page</a> into <code>%appdata%\\.minecraft\\mods</code>.</p><p>Additionally, it is recommended to get other allowed mods from <a href="https://mods.tildejustin.dev/" target="_blank" rel="noreferrer">https://mods.tildejustin.dev/</a>.</p><h2 id="launch-the-profile" tabindex="-1">Launch the Profile <a class="header-anchor" href="#launch-the-profile" aria-label="Permalink to &quot;Launch the Profile&quot;">​</a></h2><p>When you open your Minecraft launcher it will now show Fabric as an option. With that your mods will work.</p><h2 id="advanced-update-java" tabindex="-1">(Advanced) Update Java <a class="header-anchor" href="#advanced-update-java" aria-label="Permalink to &quot;(Advanced) Update Java&quot;">​</a></h2><p>It&#39;s generally recommended to use <code>Java 17+</code> for speedrunning for better performance and compatibility with some practice mods. Check out the relevant sections of <a href="https://docs.google.com/document/d/1PIjyPMulI3r5aZpfywt5OQR_12qEzX5UTfU8DQHtNp8/edit?pli=1&amp;tab=t.0#heading=h.62ygxgaxcs5a" target="_blank" rel="noreferrer">this document</a> for a guide.</p>',13)]))}const f=e(o,[["render",i]]);export{m as __pageData,f as default};
